import React, { useEffect, useState, useMemo, useCallback } from "react";
import { 
  Tabs, 
  Tab, 
  Box, 
  Typography, 
  TextField,
  InputAdornment,
  Fade,
  Skeleton,
} from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import { useDispatch, useSelector } from "react-redux";
import Item from "../../components/Item";
import { setItems } from "../../state";

const API_URL = "https://sprint9-ecommerce-production.up.railway.app/api/items?populate=image&pagination[limit]=50";

const CATEGORIES = [
  { label: "ALL", value: "all" },
  { label: "JAZZ", value: "jazz" },
  { label: "POP", value: "pop" },
  { label: "ROCK", value: "rock" },
  { label: "SOUL", value: "soul" },
];

const ShoppingList = () => {
  const dispatch = useDispatch();
  const [selectedCategory, setSelectedCategory] = useState("all");
  const [searchTerm, setSearchTerm] = useState("");
  const [isLoading, setIsLoading] = useState(true);
  const items = useSelector((state) => state.cart.items);

  const handleCategoryChange = useCallback((event, newValue) => {
    setSelectedCategory(newValue);
  }, []);

  const handleSearchChange = useCallback((event) => {
    setSearchTerm(event.target.value);
  }, []);

  const filteredItems = useMemo(() => {
    return items.filter(item => {
      const matchesCategory = selectedCategory === "all" || 
        item.attributes?.category?.toLowerCase() === selectedCategory;

      const matchesSearch = searchTerm.trim() === "" ||
        item.attributes?.name?.toLowerCase().includes(searchTerm.toLowerCase());

      return matchesCategory && matchesSearch;
    });
  }, [items, selectedCategory, searchTerm]);

  useEffect(() => {
    const handleExternalCategoryChange = (event) => {
      setSelectedCategory(event.detail.category);
    };

    window.addEventListener('categoryChange', handleExternalCategoryChange);

    const savedCategory = sessionStorage.getItem('selectedCategory');
    if (savedCategory && CATEGORIES.some(cat => cat.value === savedCategory)) {
      setSelectedCategory(savedCategory);
      sessionStorage.removeItem('selectedCategory');
    }

    return () => {
      window.removeEventListener('categoryChange', handleExternalCategoryChange);
    };
  }, []);

  useEffect(() => {
    const fetchItems = async () => {
      setIsLoading(true);
      try {
        const response = await fetch(API_URL, { 
          method: "GET",
          headers: {
            'Content-Type': 'application/json',
          }
        });

        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }

        const itemsData = await response.json();

        if (itemsData.data && Array.isArray(itemsData.data)) {
          dispatch(setItems(itemsData.data));
        } else {
          console.error("Unexpected API response structure:", itemsData);
          dispatch(setItems([]));
        }
      } catch (error) {
        console.error("Error fetching items:", error);
        dispatch(setItems([]));
      } finally {
        setIsLoading(false);
      }
    };

    fetchItems();
  }, [dispatch]);

  const renderLoadingSkeleton = () => (
    <Box
      sx={{
        display: "grid",
        gridTemplateColumns: {
          xs: "1fr",
          sm: "repeat(2, 1fr)",
          lg: "repeat(3, 1fr)",
        },
        gap: { xs: 3, md: 4 },
        width: "100%",
      }}
    >
      {[1, 2, 3, 4, 5, 6].map((i) => (
        <Box key={i} sx={{ width: "100%" }}>
          <Skeleton 
            variant="rectangular" 
            width="100%"
            height={400} 
            sx={{ borderRadius: 1 }} 
          />
          <Skeleton variant="text" width="70%" sx={{ mt: 1 }} />
          <Skeleton variant="text" width="40%" />
        </Box>
      ))}
    </Box>
  );

  const renderContent = () => {
    if (isLoading) {
      return renderLoadingSkeleton();
    }

    if (filteredItems.length === 0) {
      return (
        <Box sx={{ textAlign: "center", py: 8 }}>
          <Typography variant="h6" color="text.secondary">
            {searchTerm ? "No albums found" : "No albums available"}
          </Typography>
          <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
            {searchTerm ? "Try a different search" : "Check back later"}
          </Typography>
        </Box>
      );
    }

    return (
      <Box
        sx={{
          display: "grid",
          gridTemplateColumns: {
            xs: "1fr",
            sm: "repeat(2, 1fr)",
            lg: "repeat(3, 1fr)",
          },
          gap: { xs: 3, md: 4 },
          width: "100%",
        }}
      >
        {filteredItems.map((item) => (
          <Box
            key={`item-${item.id}`}
            sx={{
              width: "100%",
              transition: "all 0.4s cubic-bezier(0.4, 0, 0.2, 1)",
              "&:hover": {
                transform: "translateY(-12px)",
              },
            }}
          >
            <Item item={item} />
          </Box>
        ))}
      </Box>
    );
  };

  return (
    <Box 
      component="section"
      id="shopping-list"
      sx={{
        width: "100%",
        maxWidth: "100vw",
        overflow: "hidden",
        px: { xs: 2, sm: 3, md: 4, lg: 6 },
        py: { xs: 6, md: 8 },
      }}
    >
      <Box
        sx={{
          maxWidth: "1400px",
          margin: "0 auto",
          width: "100%",
        }}
      >
        {/* Header */}
        <Typography 
          variant="h3"
          component="h2"
          textAlign="center"
          sx={{ 
            mb: 4,
            fontSize: { xs: "1.75rem", sm: "2.25rem", md: "2.75rem" },
            fontWeight: 600,
          }}
        >
          Our Featured <Box component="span" sx={{ color: "primary.main" }}>Albums</Box>
        </Typography>

        {/* Search */}
        <Box sx={{ maxWidth: "500px", margin: "0 auto", mb: 4 }}>
          <TextField
            value={searchTerm}
            onChange={handleSearchChange}
            placeholder="Search albums..."
            fullWidth
            size="small"
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <SearchIcon fontSize="small" sx={{ color: "text.disabled" }} />
                </InputAdornment>
              ),
            }}
            sx={{
              "& .MuiOutlinedInput-root": {
                borderRadius: 1,
                backgroundColor: "transparent",
                transition: "all 0.2s ease",
                "&:hover": {
                  backgroundColor: "action.hover",
                },
                "&.Mui-focused": {
                  backgroundColor: "transparent",
                },
                "& fieldset": {
                  borderColor: "divider",
                },
                "&:hover fieldset": {
                  borderColor: "text.secondary",
                },
              },
            }}
          />
        </Box>

        {/* Tabs */}
        <Box sx={{ display: "flex", justifyContent: "center", mb: 5 }}>
          <Tabs
            value={selectedCategory}
            onChange={handleCategoryChange}
            textColor="primary"
            indicatorColor="primary"
            variant="scrollable"
            scrollButtons="auto"
            sx={{
              minHeight: "auto",
              "& .MuiTabs-indicator": {
                height: 1,
              },
              "& .MuiTab-root": {
                minHeight: "auto",
                minWidth: { xs: 70, sm: 90 },
                py: 1.5,
                px: { xs: 2, sm: 3 },
                fontSize: { xs: "0.813rem", sm: "0.875rem" },
                fontWeight: 500,
                letterSpacing: "0.5px",
                textTransform: "uppercase",
                color: "text.secondary",
                transition: "color 0.2s ease",
                "&:hover": {
                  color: "text.primary",
                },
                "&.Mui-selected": {
                  color: "primary.main",
                },
              },
            }}
          >
            {CATEGORIES.map((category) => (
              <Tab 
                key={category.value}
                label={category.label}
                value={category.value}
              />
            ))}
          </Tabs>
        </Box>

        {/* Content */}
        <Fade in timeout={400}>
          <Box>{renderContent()}</Box>
        </Fade>

        {/* Count */}
        {!isLoading && filteredItems.length > 0 && (
          <Typography 
            variant="body2" 
            color="text.secondary" 
            textAlign="center"
            sx={{ mt: 5, opacity: 0.7 }}
          >
            {filteredItems.length} {filteredItems.length === 1 ? 'album' : 'albums'}
            {searchTerm && ` · "${searchTerm}"`}
            {selectedCategory !== 'all' && ` · ${selectedCategory}`}
          </Typography>
        )}
      </Box>
    </Box>
  );
};

export default ShoppingList;
